import React from 'react';

function ParkCard({ park }) {

    const { name, image } = park;

    return(

    <div>
        {park.name}
    </div>
    )



return (
    <li className="card">
      <img src={image} alt={name} />
      <h4>{name}</h4>
    </li>
  );
}

export default ParkCard;
